SET check_function_bodies = false;

DROP SEQUENCE IF EXISTS public.invoicelines_id_seq CASCADE;
CREATE SEQUENCE public.invoicelines_id_seq
    START WITH 2240
    INCREMENT BY 1
    NO MINVALUE
    MAXVALUE 2147483647
    CACHE 1;

DROP TABLE IF EXISTS public.invoice_lines CASCADE;
CREATE TABLE public.invoice_lines (
    id integer DEFAULT nextval('public.invoicelines_id_seq'::regclass) NOT NULL,
    invoice_id integer NOT NULL,
    track_id integer NOT NULL,
    unit_price numeric(10,2) NOT NULL,
    quantity integer NOT NULL
);

DROP SEQUENCE IF EXISTS public.invoices_id_seq CASCADE;
CREATE SEQUENCE public.invoices_id_seq
    START WITH 412
    INCREMENT BY 1
    NO MINVALUE
    MAXVALUE 2147483647
    CACHE 1;

DROP TABLE IF EXISTS public.invoices CASCADE;
CREATE TABLE public.invoices (
    id integer DEFAULT nextval('public.invoices_id_seq'::regclass) NOT NULL,
    customer_id integer NOT NULL,
    device_id character varying(40),
    invoice_date timestamp without time zone NOT NULL,
    billing_address character varying(70),
    billing_city character varying(40),
    billing_state character varying(40),
    billing_country character varying(40),
    billing_postal_code character varying(10),
    total numeric(10,2) NOT NULL
);

ALTER TABLE ONLY public.invoice_lines
    ADD CONSTRAINT ok_invoice_lines PRIMARY KEY (id);
ALTER TABLE ONLY public.invoices
    ADD CONSTRAINT pk_invoices PRIMARY KEY (id);
CREATE INDEX ifk_invoice_customer_id ON public.invoices USING btree (customer_id);
CREATE INDEX ifk_invoice_line_invoice_id ON public.invoice_lines USING btree (invoice_id);
CREATE INDEX ifk_invoice_line_track_id ON public.invoice_lines USING btree (track_id);
ALTER TABLE ONLY public.invoice_lines
    ADD CONSTRAINT fk_invoice_line_invoice_id FOREIGN KEY (invoice_id) REFERENCES public.invoices(id);


